import viewDataService from "../server/view-data-service";
import serverToClient from "../server/photos/photo-data-conversion";

function HomePage({ keywords, photos }) {
  return <div>Welcome to Next.js! {keywords} </div>;
}

export async function getStaticProps(context) {
  return Promise.all([
    viewDataService.getPhotoData(),
    viewDataService.getAllKeywords(),
  ]).then(([photoData, allKeywords]) => {
    const mappedPhotos = photoData.photos.map((p) =>
      serverToClient(p, photoData.base)
    );
    return {
      props: {
        keywords: allKeywords,
        photos: mappedPhotos,
      },
    };
  });
}

export default HomePage;
